B.RP=new A.i_("\"I believe smartphones are the modern man's Swiss army knife. When it comes to developing applications to make one's life easier, the possibilities are limited only by the developer's imagination.\"",null,B.Pz,B.aO,null)
B.RQ=new A.i_("I've always held a fascination for software development and have been a fervent smartphone enthusiast since the days of my first Blackberry. Despite not pursuing software engineering in my university studies, the realm of software development remained somewhat of a 'black box' to me during that time. It wasn't until 2021 that I delved into the captivating world of software engineering. In August of that year, I discovered an online tutorial guiding me through the process of creating an app in Android Studio. Soon after, I proudly developed my first app. Two years after that initial foray into Android app development, I took a leap of faith, transitioning from an R&D engineer to an Android & iOS developer. Since making that decision, I've been immersed in this role, primarily crafting applications using the Flutter framework. However, my skill set extends beyond Flutter, encompassing native Android, iOS, and web development.",null,B.iV,null,null)
